import { motion } from 'framer-motion';

function Projects() {
  return (
    <motion.section
      className="section projects"
      initial={{ opacity: 0, y: 30 }}
      whileInView={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.8, delay: 0.2 }}
      viewport={{ once: true }}
    >
      <h2>Projects</h2>
      <div className="projects-grid">
        <motion.div
          className="project"
          initial={{ scale: 0.9, opacity: 0 }}
          whileInView={{ scale: 1, opacity: 1 }}
          transition={{ duration: 0.5, delay: 0.2 }}
          viewport={{ once: true }}
        >
          <h3>Project One</h3>
          <p>A responsive portfolio website built with React and styled with modern CSS techniques. Features smooth animations and a contact form.</p>
          <a href="https://github.com" className="project-link">View Project</a>
        </motion.div>
        <motion.div
          className="project"
          initial={{ scale: 0.9, opacity: 0 }}
          whileInView={{ scale: 1, opacity: 1 }}
          transition={{ duration: 0.5, delay: 0.3 }}
          viewport={{ once: true }}
        >
          <h3>Project Two</h3>
          <p>An e-commerce platform with product filtering, cart functionality, and secure checkout, built with Node.js and Express.</p>
          <a href="https://github.com" className="project-link">View Project</a>
        </motion.div>
        <motion.div
          className="project"
          initial={{ scale: 0.9, opacity: 0 }}
          whileInView={{ scale: 1, opacity: 1 }}
          transition={{ duration: 0.5, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <h3>Project Three</h3>
          <p>A task management app with real-time updates, user authentication, and drag-and-drop functionality, using Firebase.</p>
          <a href="https://github.com" className="project-link">View Project</a>
        </motion.div>
      </div>
    </motion.section>
  );
}

export default Projects;
